    printf("// Reset for a few clock cycles\n");
    printf("\n");
    printf("#1000\n");  
    printf("\n");
    printf("rst = 0;\n"); 
    printf("test_num = test_num + 1;\n");        
    printf("#1000\n");  
    printf("we = 1;\n");
    for (uint8_t i=0;i<128;i++)
    {
        printf("address_ina = %d;\n",2*i);
        printf("address_inb = %d;\n",2*i+1);
        printf("data_ina = 16'h%hx;\n",input[2*i]);
        printf("data_inb = 16'h%hx;\n",input[2*i+1]);
        printf("#10;\n");
    }
printf("        wait(init_done);\n");
printf("        #30\n");
printf("        we = 0;\n");
printf("        // Start processing\n"); 
